import PropTypes from 'prop-types'

const Button = ({text, onClick}) => {
    return (
        <div className='btn'>
            <button onClick = {onClick}>
                {text}
            </button>
        </div>
    )
}

Button.propTypes = {
    text: PropTypes.string,
    onClick: PropTypes.func.isRequired,
}

export default Button
